export class Estudiante {
    constructor(id, nombre, apellido, email, telefono, direccion, acudiente) {
        this.id = id;
        this.nombre = nombre;
        this.apellido = apellido;
        this.email = email;
        this.telefono = telefono;
        this.direccion = direccion;
        this.acudiente = acudiente;
    }
}
